import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Book search</h1>
      </header>
      <body>
        <input type="text" name="author"></input>

        <input type="text" name="title"></input>
      </body>
    </div>
  );
}

export default App;
